def multiply_numeric_digits(input_data):
    # Split the input data into lines
    data_lines = input_data.strip().split('\n')

    # Extract numeric digits after ':' and store them in a list
    numeric_digits = []
    for line in data_lines:
        parts = line.split(':')
        if len(parts) > 1:
            numeric_part = parts[1].strip()
            if numeric_part.isdigit():
                numeric_digits.append(int(numeric_part))

    # Multiply all the elements in the list
    result = 1
    for num in numeric_digits:
        result *= num

    # Count of digits stored
    digit_count = len(numeric_digits)

    return result, digit_count

def compare_datasets(dataset1, dataset2):
    result1, digit_count1 = multiply_numeric_digits(dataset1)
    result2, digit_count2 = multiply_numeric_digits(dataset2)

    if digit_count1 != digit_count2:
        return "Datasets have different digit counts"
    
    if result1 > result2:
        return "Multiplication of Rosalind set is higher"
    elif result2 > result1:
        return "Multiplication of Computed set is higher"
    else:
        return "Datasets are equal"

